import { Link, NavLink } from 'react-router-dom'

const Navbar = () => {
  return (
    <nav className='navbar'>
        <div className='main-container'>
            <div className='logo'>
                <h1>Logo</h1>
            </div>
            <div className='nav-links'>
                <ul>
                    <li>
                        <NavLink to='/src/components/home/Home.js'>Home</NavLink>
                    </li>
                    <li>
                        <NavLink to='../Calc.js'>Calc</NavLink>
                    </li>
                    <li>
                        <NavLink to='/components/home/Home.js'>Home</NavLink>
                    </li>
                </ul>
            </div>
        </div>
    </nav>
  );
};

function CustomLink({ to, children, ...props }) {
    const path = window.location.pathname;

    return (
        <li className={path === to ? "active" : ""}>
            <Link to={to} {...props}>
                {children}
            </Link>
        </li>
    )
}

export default Navbar
